import React from "react";

function Header (){
    return (
        <header>
            <ul>
                <li>
                <img
                    src="https://www.logolynx.com/images/logolynx/bd/bdb4767220c29c67a6a332864b8ecaa1.jpeg"
                    alt="Meme"
                />
                </li>
                <li>A Meme Generator</li>
            </ul>
        </header>
    )
}

export default Header;
